/**
 * @ignore
 */
export interface JsbridgeRequestOptions {
    /**
     * 请求URL
     */
    url: string;
    /**
     * 请求数据
     */
    data?: object;
}
/**
 * @ignore
 */
export interface JsbridgeRequestResponse {
    /**
     * 状态码
     */
    status: {
        /**
         * Code 码
         */
        code: number;
        /**
         * 状态内容
         */
        message: string;
    };
    /**
     * 响应结果
     */
    result: object | null;
}
/**
 * @ignore
 */
export default function jsbridge(options: JsbridgeRequestOptions): Promise<JsbridgeRequestResponse>;
